script: |
  super -f text -I q2394.spq | sort > q2394.out

inputs:
  - name: q2394.spq
    data: |
      SELECT + col0 FROM tab2 (FORMAT parquet) WHERE NOT ( NOT ( NOT ( + 38 * col1 + + col0 ) IN ( col2 + col1 * 85 ) ) );
  - name: tab2

outputs:
  - name: q2394.out
    data: |
      46
      64
      75
